import React, { useState } from 'react';
import { useHistory } from 'react-router-dom';

const NewStackModal = ({ closeModal }) => {
    const [name, setName] = useState('');
    const [description, setDescription] = useState('');
    const history = useHistory();

    const handleCreate = () => {
        const stacks = JSON.parse(localStorage.getItem('stacks')) || [];
        stacks.push({ name, description });
        localStorage.setItem('stacks', JSON.stringify(stacks));
        closeModal();
        history.push('/stacks');
    };

    return (
        <div className="modal">
            <div className="modal-content">
                <h2>Create New Stack</h2>
                <label>
                    Name:
                    <input type="text" value={name} onChange={(e) => setName(e.target.value)} />
                </label>
                <label>
                    Description:
                    <input type="text" value={description} onChange={(e) => setDescription(e.target.value)} />
                </label>
                <button onClick={handleCreate} disabled={!name || !description}>Create</button>
                <button onClick={closeModal}>Cancel</button>
            </div>
        </div>
    );
};

export default NewStackModal;
